                    <div class="contents">
                        <?php
                            $generators = array();
                            foreach($toTheFuture['generators'] as $item) {
                                $picture = $item['picture'];
                                $title = $item['title'];
                                $energy = $item['energy'];
                                $state = $item['state'];

                                array_push($generators, $state);

                                echo <<<ITEM
                                    <div class="item" target="$state">
                                        <div class="picture" style="background-image: url($picture)"></div>
                                        <span class="content">
                                            $title
                                            <span class="energy">$energy</span>
                                        </span>
                                    </div>
                                ITEM;
                            }
                        ?>
                    </div>
                    <script>
                        const states = <?php echo json_encode($generators); ?>;
                        states.forEach(function(state){
                            state = state.toLowerCase();
                            let statePath = document.getElementById(state);

                            if(statePath) {
                                statePath.classList.add("active");
                            }
                        });
                    </script>
                </div>
            </div>
        </section>
        <section class="management">
            <div class="container">
                <?php 
                    $management = get_field('management');
                    echo $management['content'];
                ?>
                <div class="blocks">
                    <?php 
                        foreach($management['blocks'] as $block) {
                            $content = $block['content'];

                            echo <<<BLOCK
                                <div class="block">
                                    $content
                                </div>
                            BLOCK;
                        }
                    ?>
                </div>
            </div>
        </section>
    </div>
